	/**
	 * Overrides the ancestor's method
	 * 
	 * @param ps
	 */
	protected void process ( ParameterSet ps )
	{
		Debug.println ( Debug.TRACE, "AUTORIZAR_SERVICIO_ADL Step " + this.currentStep );
		super.process ( ps );
		switch ( this.currentStep ) 
		{
		case 0:  { this.currentStep ++; this.step0 ( this.keyParms ); break; }
		case 1:  { this.currentStep ++; this.step1 ( this.keyParms ); break; }
		case 2:  { this.currentStep ++; this.step2 ( this.keyParms ); break; }
		case 3:  { this.currentStep ++; this.step3 ( this.keyParms ); break; }
		case 4:  { this.currentStep ++; this.step4 ( this.keyParms ); break; }
		case 5:  { this.currentStep ++; this.step5 ( this.keyParms ); break; }
		case 6:  { this.currentStep ++; this.step6 ( this.keyParms ); break; }
		case 7:  { this.currentStep ++; this.step7 ( this.keyParms ); break; }
		default: 
		{ 
			this.currentStep = 0;
			Debug.println ( Debug.TRACE, "AUTORIZAR_SERVICIO_ADL ended" );
			this.unregister ( );
			break;
		}
		}
		if ( this.currentStep > 0 ) this.app.goOn ( );
	}



	/**
	 *
	 */
	protected void step0 ( ParameterSet ps )
	{

		this.app.COD_ACCESS_GBL = "AUTO";
		SECURITY_ADL.exec ( this.app );
		return;

	}


	/**
	 *
	 */
	protected void step1 ( ParameterSet ps )
	{

		if ( Compare.equals ( this.app.ACCESS_STATUS_GBL, "FAILURE" ) ) 
		{
			this.app.setError ( 0, 1006 );
			this.doReturn ( );
			return; 
		}
		NULL_VAR = TruncService.setNull ( NULL_VAR  );
		if ( ! Compare.equals ( this.app.form ( "SERV_FAM_FRM" ).getStringItem ( "COD_STATUS_SERVICIO" ), "PENDAUTO" ) ) 
		{
			this.app.setError ( 1, 4001 );
			this.doReturn ( );
			return; 
		}
		if ( ( Compare.le ( this.app.form ( "SERV_FAM_FRM" ).getDoubleItem ( "VLR_BENEFICIO" ), 0 ) ) && ( ! Compare.equals ( RallyStringService.subString ( this.app.COD_SERV_GBL, 0, 2 ), "LI" ) )  ) 
		{
			this.app.setError ( 2, 4010 );
			this.doReturn ( );
			return; 
		}
		TECNICO_RO_DSD = this.dm.create ( "TECNICO_RO_DSD" );
		OPEN_ID = TECNICO_RO_DSD.getId ( );
		STATUS_ID = RallyDataStoreException.getDefault ( );
		if ( ! Compare.equals ( STATUS_ID, 0 ) ) 
		{
			this.app.setError ( 3, STATUS_ID );
			this.doReturn ( );
			return; 
		}
		NUCLEO_READ_LOC_DSD = this.dm.create ( "NUCLEO_READ_LOC_DSD" );
		OPEN2_ID = NUCLEO_READ_LOC_DSD.getId ( );
		STATUS2_ID = RallyDataStoreException.getDefault ( );
		if ( ! Compare.equals ( STATUS2_ID, 0 ) ) 
		{
			this.app.setError ( 4, STATUS2_ID );
			this.doReturn ( );
			return; 
		}
		CLIENTES_READ_LOC_DSD = this.dm.create ( "CLIENTES_READ_LOC_DSD" );
		OPEN3_ID = CLIENTES_READ_LOC_DSD.getId ( );
		STATUS3_ID = RallyDataStoreException.getDefault ( );
		if ( ! Compare.equals ( STATUS3_ID, 0 ) ) 
		{
			this.app.setError ( 5, STATUS3_ID );
			this.doReturn ( );
			return; 
		}
		SERVICIOS_READ_LOC_DSD = this.dm.create ( "SERVICIOS_READ_LOC_DSD" );
		OPEN4_ID = SERVICIOS_READ_LOC_DSD.getId ( );
		STATUS4_ID = RallyDataStoreException.getDefault ( );
		if ( ! Compare.equals ( STATUS4_ID, 0 ) ) 
		{
			this.app.setError ( 6, STATUS4_ID );
			this.doReturn ( );
			return; 
		}

		SERVICIOS2_DSD = this.dm.create("SERVICIOS2_DSD");
		OPEN5_ID = SERVICIOS2_DSD.getId();
		STATUS5_ID = RallyDataStoreException.getDefault();

		STATUS5_ID  = this.dm.reset ( OPEN5_ID );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", this.app.SS_SERV_GBL );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "COD_SERVICIO", this.app.COD_SERV_GBL );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );
		STATUS5_ID  = this.dm.limitQueryFromBuffer ( OPEN5_ID );
		STATUS5_ID  = this.dm.retrieve ( OPEN5_ID );

		STATUS5_ID  = this.dm.firstRow ( OPEN5_ID );
		if( Compare.equals ( STATUS5_ID, 0 ))
		{
			if(Compare.equals(this.dm.getFieldString ( this.dm.get ( "SERVICIOS2_DSD" ), "SERV_SOSTENEDOR" ),"INCE"))
			{
				if( ! Compare.equals(this.dm.getFieldString ( this.dm.get ( "SERVICIOS2_DSD" ), "ACTIVIDAD" ),"D"))
				{
					this.app.setError("0","El tipo de actividad para INCENTIVO debe ser Servicio Comunitario.");
					this.doReturn ( );
					this.app.callCommand("FINISH ACTION");
					return;
				}
			}
			if (Compare.gt(this.dm.getFieldDouble ( this.dm.get ( "SERVICIOS2_DSD" ), "PAGO_POR_DIA" ),5))
			{
				this.app.setError("0","NOTA, pago sobre pasa los $5.00.");
			}
			if(Compare.equals(this.dm.getFieldString ( this.dm.get ( "SERVICIOS2_DSD" ), "SERV_SOSTENEDOR" ),"DIET"))
			{
				if (Compare.equals(this.dm.getFieldString ( this.dm.get ( "SERVICIOS2_DSD" ), "TIPO_ALIMENTACION" ),"MERI"))
				{
					if (Compare.gt(this.dm.getFieldDouble ( this.dm.get ( "SERVICIOS2_DSD" ), "PAGO_POR_DIA" ),2))
					{
						this.app.setError("0","NOTA, pago por merienda sobre pasa los $2.00.");
					}
				}
			}
		}

		STATUS4_ID  = this.dm.reset ( OPEN4_ID );

		this.dm.setField ( this.dm.get ( "SERVICIOS_READ_LOC_DSD" ), "SEGURO_SOCIAL_JEFE_FAM", this.app.form ( "SERV_FAM_FRM" ).getDoubleItem ( "SEGURO_SOCIAL_JEFE_FAM" ));
		this.dm.setField ( this.dm.get ( "SERVICIOS_READ_LOC_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", this.app.form ( "SERV_FAM_FRM" ).getDoubleItem ( "SEGURO_SOCIAL_JEFE_SERV" ));
		this.dm.setField ( this.dm.get ( "SERVICIOS_READ_LOC_DSD" ), "COD_SERVICIO", this.app.form ( "SERV_FAM_FRM" ).getStringItem ( "COD_SERVICIO" ));
		this.dm.setField ( this.dm.get ( "SERVICIOS_READ_LOC_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );

		STATUS4_ID  = this.dm.limitQueryFromBuffer ( OPEN4_ID );
		STATUS4_ID  = this.dm.retrieve ( OPEN4_ID );

		STATUS4_ID  = this.dm.firstRow ( OPEN4_ID );

		if ( ! Compare.equals ( STATUS4_ID, 0 ) ) 
		{
			STATUS4_ID  = this.dm.dbClose ( OPEN4_ID );

			this.app.setError ( 7, STATUS4_ID );
			this.doReturn ( );
			return; 
		}
		if ( ( Compare.equals ( this.dm.getFieldDouble ( this.dm.get ( "SERVICIOS_READ_LOC_DSD" ), "NUM_MESES" ), NULL_VAR ) ) && ( ! Compare.equals ( RallyStringService.subString ( this.app.COD_SERV_GBL, 0, 2 ), "LI" ) )  ) 
		{
			STATUS4_ID  = this.dm.dbClose ( OPEN4_ID );

			this.app.setError ( 8, 2760 );
			this.doReturn ( );
			return; 
		}

		STATUS_ID  = this.dm.rollBack ( );
		STATUS_ID  = this.dm.dbClose ( OPEN_ID );

		STATUS4_ID  = this.dm.dbClose ( OPEN4_ID );

		if ( Compare.equals ( this.app.RUTINA_GBL, "MC" ) ) 
		{
			MANTENIMIENTO_DE_CASOS_ADL.setCOMPLETION_STATUS ( this.app, "SUCCESS" );
		}
		else if ( Compare.equals ( this.app.RUTINA_GBL, "AC" )  )
		{
			APERTURA_DE_CASO_ADL.setCOMPLETION_STATUS ( this.app, "SUCCESS" );
		}
		this.app.MANT_ACCION_SERV_GBL = "AS";
		this.app.FLAG_UPD_GBL = "N";
		if ( Compare.equals ( RallyStringService.subString ( this.app.COD_SERV_GBL, 0, 2 ), "LI" ) ) 
		{
			this._condition0 = true;
		}
		else
		{
			this._condition0 = false;
		}
		if ( this._condition0 )
		{
			this.app.SS_JEFE_GBL = this.app.form ( "SERV_FAM_FRM" ).getDoubleItem ( "SEGURO_SOCIAL_JEFE_FAM" );
			this.app.SS_SERV_GBL = this.app.form ( "SERV_FAM_FRM" ).getDoubleItem ( "SEGURO_SOCIAL_JEFE_SERV" );
			this.app.COD_SERV_GBL = this.app.form ( "SERV_FAM_FRM" ).getStringItem ( "COD_SERVICIO" );
			PHASE_COUNT = 1;
			this.process ( ps );
		}

	}


